import React from "react";

export default function DisplayDate() {
  return (
    <>
      <div className="showDate">
        {this.state.selectedDay +
          "/" +
          this.state.dateObject.format("MMMM") +
          "/" +
          this.state.dateObject.format("Y")}
      </div>
    </>
  );
}
